import React from "react";

const CardOrder = ({ orders }) => {
  return (
    <>
      {orders.map((order) => (
        <div key={order.id} className="col-12 col-sm-4 ">
          {order.table}
          <div className="card p-3">
            <div className="card-header">{order.table}</div>
          </div>
        </div>
      ))}
    </>
  );
};

export default CardOrder;
